import {EditableObject} from './editableObject';
export class EditableTableCell {
    private object: EditableObject;
    private style: string;

    constructor(object: EditableObject, style?: string) {
        this.object = object;
        this.style = style;
    }

    getEditableObject() {
        return this.object;
    }

    getStyle() {
        return this.style;
    }
}
